    public static function getLevelData($user_id)
    {

        $userSetting = UserSettings::with(['user' => function ($query) {
            $query->select('id', 'uid', 'name');
        }])->where('user_id', $user_id)->first();

        if (empty($userSetting)) {
            UserSettings::init($user_id);

            $userSetting = UserSettings::with(['user' => function ($query) {
                $query->select('id', 'uid', 'name');
            }])->where('user_id', $user_id)->first();
        }
        return $userSetting->level_data;
    }

