                'uid'                 => $user->uid,
                'item_id'             => $avatar_itme_id,
                'qty'                 => 1,
                'is_lock'             => 1,
                'memo'                => 'init_create_give',
                'user_mall_order_id'  => null,
                'user_pay_order_id'   => null,
                'user_gacha_order_id' => null,
            ];
        }

        // 家具
        $furnitureIds = [
            2040002,2050001,2050003,2050017,2050021,
            2070000,2070009,2070018,2070021,2070025,
