            1030000,1030001,1030002,1030003,1030004,1030005,1030006,1030007,1030008,1030009,1030010,1030011,1030012,1030013
        ];

        
        foreach ($furnitureIds as $furniture_itme_id) {
            $addItems[] = [
                'type'                => UserItemLogs::TYPE_INIT,
                'user_id'             => $user->id,
                'uid'                 => $user->uid,
                'item_id'             => $furniture_itme_id,
                'qty'                 => 1,
                'is_lock'             => 1,
                'memo'                => 'init_create_give',
                'user_mall_order_id'  => null,
                'user_pay_order_id'   => null,
                'user_gacha_order_id' => null,
            ];
        }

        $itemIds = array_unique(array_column($addItems, 'item_id'));

        // 批量查詢 UserItems
        $existingItems = UserItems::where('user_id', $user->id)
            ->whereIn('item_id', $itemIds)
            ->get()
            ->keyBy(fn($item) => $item->user_id . '_' . $item->item_id);

        $tempItems = $addItems;
        $addItems  = [];
        foreach ($tempItems as $item) {
            $key = $item['user_id'] . '_' . $item['item_id'];

            if (isset($existingItems[$key])) {
                $userItem = $existingItems[$key];
                if ($userItem->region === 'Avatar') {
                    continue;
                } else if ($userItem->qty >= $item['qty']) {
                    continue;
                }
            }
            $addItems[] = $item;
        }

        if (!empty($addItems)) {
            $result = UserItemService::addItems($addItems);
            if (! $result['success']) {
                return ['success' => 0, 'error_code' => $result['error_code']];
            }
        }

        $user->new_give = 1;
        $user->save();
        return ['success' => 1];

    }

    public static function addLoginLog($uid, $ip, $methods, $login_data)
    {
    try {
        UserLoginLogs::create([
            'uid' => $uid,
            'ip' => $ip,
            'methods' => $methods,
            'login_data' => json_encode($login_data),
        ]);

        // 更新最後登入時間
        $user = Users::where('uid', $uid)->first();
        $user->last_login_time = now();
        $user->save();

    } catch (\Throwable $e) {
        \Log::error('新增登入紀錄失敗', [
            'uid' => $uid,
            'ip' => $ip,
            'methods' => $methods,
            'login_data' => $login_data,
            'error' => $e->getMessage(),
        ]);
    }
    }
